import React from 'react'

export const LandlordHouseDisplay = (props) => {
    return (
        <div>
            <p>{props.state}</p>
            <p>{props.address}</p>
            <p>{props.city}</p>
            <p>{props.numberOfTenants}</p>


        </div>
    )
}

export default LandlordHouseDisplay
